// ==UserScript==
// @name            Bingo Craft AWWM
// @namespace       Violentmonkey Scripts
// @match           https://neal.fun/infinite-craft/*
// @grant           GM.setValue
// @grant           GM.getValue
// @grant           GM.xmlHttpRequest
// @grant           unsafeWindow
// @version         1.0.1
// @author          Alexander_Andercou
// @require         https://www.unpkg.com/csv-parse@4.15.4/lib/browser/index.js
// @description     Play bingo with AWWM orders spreadsheet
// @downloadURL     https://github.com/InfiniteCraftCommunity/userscripts/raw/master/userscripts/Bingo_AWWM/index.user.js
// @updateURL       https://github.com/InfiniteCraftCommunity/userscripts/raw/master/userscripts/Bingo_AWWM/index.user.js
// ==/UserScript==


(function () {
    let sheetApi = "https://docs.google.com/spreadsheets/d/" + "1iTUL4yuJsVAOA5wplbBb27CK_FY1lCie5wX9CH3geVk" + "/export?format=csv";

    const parser = parse({
        delimiter: ",",
    });

    let explosionAudioSrc = "data:audio/mpeg;base64,";

    function makeAudio() {
        let audio = document.createElement("audio");

        audio.src = explosionAudioSrc;
        audio.volume = 0.4;
        console.log(audio);
        document.body.appendChild(audio);
        audio.play();
    }
    
    function fetchRandomElements() {
        const elements = [];

        return new Promise((resolve) => {
            GM.xmlHttpRequest({
                method: "GET",
                url: sheetApi,
                headers: {
                    Origin: "https://infinibrowser.zptr.cc/",
                },
                onload(response) {
                    console.log(response.responseText);
                    parse(response.responseText, {}, function (err, records) {
                        let justData = records.map((x) => x[1]);
                        justData.splice(0, 3);
                        console.log(justData);
                        let choosen = [];
                        let unique = 9;
                        let usedIndex = [];
                        GM.setValue("state", "select");
                        while (unique > 0) {
                            let index = Math.floor(Math.random() * (justData.length - 1));
                            if (!usedIndex.includes(index)) {
                                choosen.push(justData[index]);
                                unique--;
                                usedIndex.push(index);
                            }
                        }

                        GM.setValue("bingoData", JSON.stringify(choosen));

                        GM.setValue("state", "show");
                    });

                    resolve();

                    // resolve(JSON.parse(response.responseText));
                },
            });
        });
    }

    let bingoSrc = "data:image/png;base64,";
    let canvas = null;

    function makeLine(x1, y1, x2, y2, otherCanvas = null) {
        let myCanvas = canvas;
        if (otherCanvas != null) myCanvas = otherCanvas;

        const ctx = myCanvas.getContext("2d");

        // Define a new path
        ctx.beginPath();
        // Set a start-point
        ctx.moveTo(x1, y1);

        // Set an end-point
        ctx.lineTo(x2, y2);
        ctx.strokeStyle = "red";
        // Stroke it (Do the Drawing)
        ctx.stroke();
    }
    
    let foundCells = [];
    let countRows = [0, 0, 0];
    let countColumns = [0, 0, 0];
    let countDiagomnals = [0, 0];

    function doModal(data) {
        let foundElements = unsafeWindow.$nuxt.$root.$children[2].$children[0].$children[0]._data.elements.filter((x) => data.includes(x.text));
        let bingoModal = null;
        let cells = null;

        if (document.querySelector(".bingoM") == null) {
            bingoModal = document.createElement("dialog");
            bingoModal.classList.add("bingoM");
            bingoModal.style.overflow = "visible";
            bingoModal.style.position = "absolute";
            cells = document.createElement("div");
            cells.classList.add("cells");
            cells.style.display = "grid";
            cells.style.gridTemplateColumns = "auto auto auto";
            cells.style.gridTemplateRows = "auto auto auto";
            bingoModal.style.left = "50%";
            bingoModal.style.top = "50%";
            bingoModal.style.transform = "translate(-50%, -50%)";
            bingoModal.style.backgroundColor = "var(--background-color)";
            bingoModal.style.color = "var(--text-color)";
            bingoModal.addEventListener("click", () => bingoModal.close());
            let title = document.createElement("h1");
            title.textContent = "Bingo Craft";
            title.style.textAlign = "center";
            bingoModal.appendChild(title);
            bingoModal.appendChild(cells);
            document.querySelector(".container").appendChild(bingoModal);
            cells.style.position = "relative";
            canvas = document.createElement("canvas");
            canvas.style.position = "absolute";
            canvas.style.top = "0";
            canvas.style.left = "0";
        } else {
            bingoModal = document.querySelector(".bingoM");
            cells = document.querySelector(".cells");
            cells.innerHTML = "";
            cells.appendChild(canvas);
        }

        for (let i = 0; i < 3; i++) {
            for (let j = 0; j < 3; j++) {
                let index = 3 * i + j;
                let elmText = data[index];

                let element = foundElements.find((x) => x.text == elmText);
                let divElm = document.createElement("div");
                let emojiSpan = document.createElement("span");
                emojiSpan.textContent = element != null ? element.emoji : "⬜";
                let itemText = document.createTextNode(elmText);
                divElm.style.display = "block";

                divElm.appendChild(emojiSpan);
                divElm.appendChild(itemText);
                // divElm.style.position = "absolute";
                divElm.setAttribute("column", j);
                divElm.setAttribute("row", i);
                divElm.style.whiteSpace = "normal";
                divElm.style.maxWidth = "500px";

                if (element != null) divElm.setAttribute("found", true);
                else divElm.setAttribute("found", false);

                //  divElm.style.textAlign = "center";

                let fullElem = document.createElement("div");
                fullElem.appendChild(divElm);
                fullElem.style.height = "100px";
                fullElem.style.display = "flex";
                fullElem.style.textAlign = "center";
                fullElem.style.justifyContent = "center";
                fullElem.style.flexDirection = "column";
                fullElem.classList.add("cell");
                cells.appendChild(fullElem);
            }
        }

        bingoModal.showModal();
        let waitdisplay = setInterval(() => {
            let cellsDiv = document.querySelector(".cells");
            console.log("pooling");
            if (cellsDiv && bingoModal.getAttribute("open") != null && document.querySelectorAll(".cell").length > 0) {
                console.log("here");

                cellsDiv = document.querySelector(".cells");
                // clearInterval(waidisplay)
                canvas.width = 500;
                canvas.height = 500;

                let cells2 = document.querySelectorAll(".cell");

                let bingo = function () {
                    countRows = [0, 0, 0];
                    countColumns = [0, 0, 0];
                    countDiagomnals = [0, 0];

                    console.log("found cells:", [...foundCells], [...countRows], [...countColumns], [...countDiagomnals]);

                    for (let fc of foundCells) {
                        countRows[fc[0]]++;
                        countColumns[fc[1]]++;
                        if (fc[1] == fc[0]) countDiagomnals[0]++;

                        if (fc[1] + fc[0] == 2) countDiagomnals[1]++;
                    }

                    return countRows.find((x) => x == 3) != null || countColumns.find((x) => x == 3) != null || countDiagomnals.find((x) => x == 3) != null;
                };

                foundCells = [];
                for (let cell of cells2) {
                    let innerDiv = cell.querySelector("div");

                    let found = innerDiv.getAttribute("found");
                    
                    if (found == "true") {
                        let column = Number(innerDiv.getAttribute("column"));
                        let row = Number(innerDiv.getAttribute("row"));
                        if (foundCells.find((x) => x[0] == row && x[1] == column) == null) foundCells.push([row, column]);

                        let top = cell.getBoundingClientRect().top - cellsDiv.getBoundingClientRect().top + 20;
                        let left = cell.getBoundingClientRect().left - cellsDiv.getBoundingClientRect().left + 20;
                        let bottom = cell.getBoundingClientRect().bottom - cellsDiv.getBoundingClientRect().top - 20;
                        let right = cell.getBoundingClientRect().right - cellsDiv.getBoundingClientRect().left - 20;

                        makeLine(left, top, right, bottom);
                        makeLine(right, top, left, bottom);
                        // break;
                    }
                }
                if (bingo()) {
                    console.log("ADD BINGO");
                    let bingoWinDiv = document.createElement("div");
                    let bingoDivText = document.createTextNode("BINGO");
                    bingoWinDiv.classList.add("WIN_BINGO");
                    bingoWinDiv.appendChild(bingoDivText);
                    bingoWinDiv.style.position = "absolute";
                    bingoWinDiv.style.top = "20%";
                    bingoWinDiv.style.left = "20%";
                    bingoWinDiv.style.color = "red";
                    bingoWinDiv.style.fontSize = "100px";

                    bingoModal.appendChild(bingoWinDiv);

                    makeAudio();
                }
            }
        }, 500);
    }

    window.addEventListener("load", async () => {
        let initialState = null;
        let data = null;

        setInterval(async () => {
            if ((await GM.getValue("state")) == "show") {
                GM.setValue("state", "playing");
                data = JSON.parse(await GM.getValue("bingoData"));
                // console.log(data);
                initialState = unsafeWindow.$nuxt.$root.$children[2].$children[0].$children[0]._data.elements.filter((x) => data.includes(x.text));

                GM.setValue("previousState", JSON.stringify(initialState));

                doModal(data);
            } else if ((await GM.getValue("state")) == "playing") {
                initialState = JSON.parse(await GM.getValue("previousState"));

                data = JSON.parse(await GM.getValue("bingoData"));

                let newState = unsafeWindow.$nuxt.$root.$children[2].$children[0].$children[0]._data.elements.filter((x) => data.includes(x.text));

                if (newState.length > initialState.length) {
                    doModal(data);
                    initialState = [...newState];
                    GM.setValue("previousState", JSON.stringify(initialState));
                }
            }
        }, 200);

        let img = document.createElement("img");
        img.src = bingoSrc;
        img.style.cssText = "width: 21px;cursor: pointer;opacity: .8;-webkit-user-select: none;-moz-user-select: none;user-select: none;}";
        document.querySelector(".side-controls").append(img);

        img.addEventListener("click", async () => {
            console.log("STARTING");

            if (document.querySelector(".bingoM") != null && document.querySelector(".WIN_BINGO") != null) {
                document.querySelector(".cells").innerHTML = "";
                console.log("remove BINGO");

                let manyWins = document.querySelectorAll(".WIN_BINGO");
                for (let win of manyWins) {
                    document.querySelector(".bingoM").removeChild(win);
                }
            }
            fetchRandomElements();
        });
    }, false);
})();
